import React from 'react';
import './PortfolioLanding.css';

function PortfolioLanding() {
  return (
    <div className="portfolio-landing">
      <header>
        <h1>Your Name</h1>
        <p>Frontend Developer</p>
      </header>

      <section className="about">
        <h2>About Me</h2>
        <p>
          Welcome to my portfolio! I am a passionate frontend developer with a
          strong focus on creating responsive and user-friendly web applications.
        </p>
      </section>

      <section className="portfolio">
        <h2>Portfolio</h2>
        {/* Add your portfolio projects here */}
      </section>

      <section className="contact">
        <h2>Contact Me</h2>
        <p>Email: your@email.com</p>
        <p>LinkedIn: linkedin.com/your-profile</p>
        {/* Add other contact information as needed */}
      </section>
    </div>
  );
}

export default PortfolioLanding;
